create table "Language"
(
    id            bigserial not null
        constraint language_pk
            primary key,
    language_name varchar(30)
);

create table "Role"
(
    id        bigserial not null
        constraint role_pk
            primary key,
    role_name varchar(10)
);

create table "Gender"
(
    id          bigserial  not null
        constraint gender_pk
            primary key,
    gender_name varchar(6) not null
);

create unique index gender_gender_name_uindex
    on "Gender" (gender_name);


create table "User"
(
    id                bigserial   not null
        constraint table_name_pk
            primary key,
    username          varchar(20) not null,
    password          varchar(50) not null,
    first_name        varchar(30) not null,
    last_name         varchar(30),
    birth_date        date,
    registration_date date        not null,
    role_id           bigint      not null
        constraint table_name_role_id_fk
            references "Role"
            on delete restrict,
    gender_id         bigint
        constraint user_gender_id_fk
            references "Gender"
            on delete restrict
);

create unique index table_name_username_uindex
    on "User" (username);


create table "Size"
(
    id        bigserial  not null
        constraint size_pk
            primary key,
    size_name varchar(5) not null
);

create unique index size_size_name_uindex
    on "Size" (size_name);


create table "Company"
(
    id           bigserial not null
        constraint company_pk
            primary key,
    company_name varchar(50),
    country      varchar(30)
);

create unique index company_company_name_uindex
    on "Company" (company_name);


create table "Clothes"
(
    id          bigserial   not null
        constraint clothes_pk
            primary key,
    price       integer     not null,
    company_id  bigint
        constraint clothes_company_id_fk
            references "Company",
    image       bytea,
    gender_id   bigint
        constraint clothes_gender_id_fk
            references "Gender",
    vendor_code varchar(30) not null
);

create unique index clothes_articulus_uindex
    on "Clothes" (vendor_code);


create table "Cloth_Details"
(
    cloth_id          bigint not null
        constraint cloth_details_clothes_id_fk
            references "Clothes",
    language_id       bigint not null
        constraint cloth_details_language_id_fk
            references "Language",
    color             varchar(50),
    number_of_pockets integer,
    season            varchar(30),
    about             text,
    pattern           varchar(200),
    name              varchar(100),
    constraint cloth_details_pk
        primary key (cloth_id, language_id)
);

create table "Cloth_Size"
(
    cloth_id bigint not null
        constraint cloth_size_clothes_id_fk
            references "Clothes",
    size_id  bigint not null
        constraint cloth_size_size_id_fk
            references "Size",
    amount   integer,
    constraint cloth_size_pk
        primary key (cloth_id, size_id)
);

create table "Review"
(
    id         bigserial not null
        constraint review_pk
            primary key,
    user_id    bigint
        constraint review_user_id_fk
            references "User",
    product_id bigint
        constraint review_clothes_id_fk
            references "Clothes",
    content    text,
    date       date
);

create table "Cart"
(
    id         bigserial not null
        constraint cart_pk
            primary key,
    user_id    bigint
        constraint cart_user_id_fk
            references "User",
    product_id bigint
        constraint cart_clothes_id_fk
            references "Clothes",
    amount     integer,
    size_id    bigint
        constraint cart_size_id_fk
            references "Size"
);


create table "Order"
(
    id          bigserial not null
        constraint order_pk
            primary key,
    date        date,
    total_price integer,
    user_id     bigint
        constraint order_user_id_fk
            references "User",
    status_id   bigint
        constraint order_status_id_fk
            references "Status"
);

create table "Order_Details"
(
    id            bigserial not null
        constraint order_details_pk
            primary key,
    order_id      bigint
        constraint order_details_order_id_fk
            references "Order",
    product_id    bigint
        constraint order_details_clothes_id_fk
            references "Clothes",
    amount        integer,
    product_price integer,
    size_id       bigint
        constraint order_details_size_id_fk
            references "Size"
);



create table "Status"
(
    id          bigserial not null
        constraint status_pk
            primary key,
    status_name varchar(30)
);

create unique index status_id_uindex
    on "Status" (id);

